import React, { Fragment } from "react";

//const array = ["carlos", "kendall", "ariel", "Jonathan"];


const P = () => {
  return (
    <Fragment>
      <h2>
        {arrayOBJ.map((el) => (
          <p key={el.id}>{el.id}</p>
        ))}
      </h2>
    </Fragment>
  );
};

export default P;
